import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';


class About extends Component {
  render() {
    return(
      <div className="about-body">
        <Grid className="about-grid">
          <Cell col={6}>
            <h2>jay bhagat</h2>
            <img
            src="frontpic.png"
            alt="frontpic"
            style={{height: '250px'}}
            />
            <p>i am currently a computer science student at the university of waterloo.
            i want to explore my passions for teaching and technology, but more specifically,
            about their connections. apart from teaching and technology, i love to research
            the wonders of our world, spend time with friends, and learn!</p>
          </Cell>
          <Cell col={6}>half page</Cell>
        </Grid>
      </div>
    )
  }
}

export default About;
